import * as React from 'react';
import {AppBar, Button, Menu} from "@mui/material";



function NavBar() {
  

  return (
   
<AppBar sx={{
  position :"fixed",
  top:"1.5%",
  display: "flex",
  justifyContent:"center",
  alignItems:"center",
    zIndex: "11",
    backgroundColor:"#341f97",
    width:"90vw",
    height:"6ch",
    borderRadius:"20px",
    right:"auto",
   }} id = "navbar">

    <div id = "buttonContainer">
      <Button>Acasă</Button>
      <Button>Noutăți</Button>
      <Button>Contact</Button>
      <Button>Legistlație</Button>
      <Button>Organizare</Button>
    </div>

   </AppBar>
   
  );
}
export default NavBar;
